import React from "react";

import ButtonStyledComp from "./ButtonStyledComp";

import classes from "./styles.module.css";

interface Props {
  title: string;
  imgContent?: any;
  backgroundParam: string;
  paddingParam: string;
  boxShadowParam: string;
  colorBackBtn: string;
  onClick: () => void;
}

export const Button: React.FC<Props> = ({
  title,
  imgContent,
  backgroundParam,
  paddingParam,
  boxShadowParam,
  colorBackBtn,
  onClick,
}) => {
  console.log(backgroundParam, "backgroundParam");
  return (
    // <div className={classes.container}>
    <ButtonStyledComp
      // className={classes.btn}
      onClick={onClick}
      backgroundParam={backgroundParam}
      padding={paddingParam}
      boxShadow={boxShadowParam}
      colorBackBtn={colorBackBtn}
    >
      {/* <button className={classes.btn} onClick={onClick} > */}
      {title}
      {imgContent && <img src={imgContent} alt="/" className={classes.img} />}
      {/* </button> */}
    </ButtonStyledComp>
    // </div>
  );
};
